"   <div class=\"lgnd\">",
"    Compartments of the leg:",
"    <br>",
"     <ul>",
"      <li>",
"       Anterior compartment (blue) &mdash; Tibialis anterior, extensor muscles of the foot, and fibularis (peroneus) tertius muscles. The anterior tibial artery and deep fibular (peroneal) nerve supply the anterior compartment.",
"      </li>",
"      <li>",
"       Lateral compartment (green) &mdash; Fibularis (peroneus) longus and fibularis (peroneus) brevis muscles. The superficial fibular (peroneal) nerve and branches from the anterior tibial artery supply these muscles.",
"      </li>",
"      <li>",
"       Superficial posterior compartment (purple) &mdash; Gastrocnemius, soleus and plantaris muscles. Tibial nerve branches supply these muscles. The arteries which supply these muscles descend from the popliteal artery. The sural arteries (medial, lateral) supply the gastrocnemius. The soleus is variably supplied by the popliteal artery, posterior tibial artery and fibular (peroneal) artery.",
"      </li>",
"      <li>",
"       Deep posterior compartment (pink) &mdash; Tibialis posterior, flexor muscles of the foot and popliteus muscles. The deep posterior compartment is innervated by the tibial nerve and supplied by the posterior tibial and fibular (peroneal) arteries.",
"      </li>",
"     </ul>",
