var title_f41_27_42430="Optimal INR oral anticoag";
var content_f41_27_42430=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F78252&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F78252&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Optimal INR for minimizing bleeding and thromboembolism when using oral anticoagulation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 491px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure shows the relative risks and their 95 percent confidence intervals for the occurrence of thromboembolism (closed circles, confidence intervals in yellow) and hemorrhage (open circles, confidence intervals in blue) as a function of the INR range in patients prescribed oral anticoagulant therapy. The comparator for both end-points is the INR range of 2.0 to 3.0 (ie, relative risk of 1.0). Note that hemorrhagic risk becomes dominant at an INR &gt;3, while thromboembolic risk is dominant at an INR &lt;2.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Oake N, et al. Anticoagulation intensity and outcomes among patients prescribed oral anticoagulant therapy: a systematic review and meta-analysis. CMAJ 2008; 179:235.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
