var title_f41_27_42431="Quantitative PCR";
var content_f41_27_42431=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F71655&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F71655&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 566px\">",
"   <div class=\"ttl\">",
"    Example of quantitative real-time polymerase chain reaction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 546px; height: 570px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The polymerase chain reaction (PCR) can be quantitated in its early exponential phase. Panel A: If there are many targets in the starting sample (eg, curves on the left), the generated fluorescent signal will cross a predetermined threshold value (C",
"    <sub>",
"     T",
"    </sub>",
"    ) early in the PCR cycling process. If there are few targets (eg, curves on the right), the signal will rise more slowly and will cross C",
"    <sub>",
"     T",
"    </sub>",
"    at a later PCR cycle. Panel B: When C",
"    <sub>",
"     T",
"    </sub>",
"    is plotted versus the starting quantity of target DNA, the relationship is linear over more than 8 logarithms. To establish the amount of targets in a sample, one can simply determine the cycle number at which C",
"    <sub>",
"     T",
"    </sub>",
"    is crossed and use the standard curve to infer the number of targets present in the sample. Panel C: In an example of a cancer patient with t(14;18), the initially large number of targets present (red curve) is markedly reduced after treatment (blue curve).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
